import React, { Component } from 'react';
import { connect } from 'react-redux'
import { users} from '../Containers/menu'



class Hi extends Component {
    constructor(props) {
      super(props);
    }
    componentDidMount() {
      this.props.users();
    }
  
  render() {
    return (
      <div>
      <center>
      <ul>
            {this.props.userinfo.map(el => (
          <li>My friends are:<br></br>{el.buddy.firstfriendname}<br></br>{el.buddy.secondfriendname}</li>
        ))}
      </ul>
      </center>
      </div>
    );
  }
}

const mapStatetoProps=(state)=> {
  return {userinfo: state.userinfo.slice(0,1)};
}

const mapDispatchtoProps = (dispatch) => {
  return {
     users: () => dispatch(users()) 
  }
}

export default connect(mapStatetoProps,mapDispatchtoProps)(Hi);
